import { useGlobalContext } from '../context'

const Projects = ({ location }) => {

	const { setCurrentPath } = useGlobalContext()

	useEffect(() => {
		setCurrentPath(location.pathname)
		console.log('run useeffect')
	}, [setCurrentPath, location.pathname])

	return (
		<div>
			<h1>Hello</h1>
		</div>
	)
}

export default Projects
